// Add member
$(function() {
	var index = 2;

	var focusHandler = function() {
		$('.request__input, .request__textarea').each(function(i, input) {
			var valueLen = $(input).val().length;
			if (valueLen === 0) {
				$(input).parent().removeClass('clicked');
			}
		});
		$(this).parent().addClass('clicked');
	};
	
	$('.request__form-member').on('click', function() {

		$('.request__form-member').before('<div class="request__member"><div class="request__group request__group--num request__group--mb"><span class="member-num">' + index + '.</span><button class="member-delete" type="button"><img src="img/minus.svg" alt=""></button><div class="request__group-input"><span>Имя Фамилия</span><input class="request__input" type="text" name="member-name" required></div></div><div class="request__group"><div class="request__group-input"><span>Роль</span><input class="request__input" type="text" name="member-role" required></div></div></div>');

		$('.request__form-member').prev().find('input[name="member-name"], input[name="member-role"]').on('focus', focusHandler);

		// Удаление инпутов
		$('.request__form-member').prev().find('.member-delete').on('click', function() {
			$(this).parent().parent().remove()
			index--;

			$('.member-num').each(function(i, el) {
				i++;

				$(el).text(i + '.');

			});

		});

		index++;

	});
	
});

function mediaQueries(width, matchCallback, callback) {
	var handleMatchMedia = function (mediaQuery) {
		if (mediaQuery.matches) {
			matchCallback();
		} else {
			callback()
		}
	};
	mql = window.matchMedia('all and (max-width: ' + width + 'px)');
	handleMatchMedia(mql);
	mql.addListener(handleMatchMedia);
}